import React from 'react'
import StickyNav from 'react-js-stickynav'
import 'react-js-stickynav/dist/index.css'
import logo1 from './images/logo1.svg' ;

const App = () => {
  const style = () => {
    return (
      <style jsx>{`
        .nav {
          transition: all 0.1s linear;
          position: fixed;
          z-index: 2000;
          padding: 20px;
          width: 100%;
          text-align:center;
          height:20%;
          background-color:#4e5157;
        }
        .scrollNav {
          transition: all 0.5s ease-in;
          z-index: 2000;
          background: #ffffff;
          width: 100%;
          border-bottom: 1px solid #dddddd;
        }
        .styl {
          padding-top: 80px;
        }
      `}</style>
    )
  }
  return (
    <div>
      {style()}
         <div className=''>

      </div>
      <div className="container">
      <StickyNav className='topleft'>insert your Navbar Component here</StickyNav>

      <img className='img' src={logo1} />

</div>

    </div>
  )
}

export default App
